import { Form, Input, Space, Button, Card, DatePicker, message } from 'antd'
import React, { Component } from 'react'
import moment from 'moment';
import UserHead from '../../components/UserHead'

export default class Index extends Component {

    // 设置不可选中时间
    disabledDate = (current) => {
        return current && current < moment().subtract(1, 'days')
    }

    // 查询
    onFinish=() => {
        message.success('查询成功')
    }

    render() {
        return (
            <div>
                <UserHead />
                <Card
                    bordered={false}
                >
                    <Form
                        layout="horizontal"
                        onFinish={this.onFinish}
                        labelCol={{ span: 2 }}
                        wrapperCol={{ span: 8 }}
                        style={{ marginLeft: '200px', marginTop: '50px' }}
                    >

                        <Form.Item
                            name="startStation"
                            label="出发地"
                            rules={[{ required: true, message: '请输入出发地' }]}
                            required="true"
                        >
                            <Input placeholder="请输入出发地" />
                        </Form.Item>


                        <Form.Item
                            name="endStation"
                            label="目的地"
                            rules={[{ required: true, message: '请输入目的地' }]}
                        >
                            <Input placeholder="请输入目的地" />
                        </Form.Item>

                        <Form.Item
                            name="startDate"
                            label="出发日期"
                            rules={[{ required: true, message: '请选择出发日期' }]}
                        >
                            <DatePicker
                                format="YYYY-MM-DD"
                                disabledDate={this.disabledDate}
                            />
                        </Form.Item>

                        <div
                            style={{
                                textAlign: 'right',
                                marginTop: '20px',
                                marginRight: '650px'
                            }}
                        >
                            <Space size="large">

                                <Button size="large" shape="round" htmlType="reset" style={{ marginRight: 30 }}>
                                    重置
                                </Button>
                                <Button  size="large" shape="round" htmlType="submit" type="primary">
                                    查询
                                </Button>
                            </Space>

                        </div>
                    </Form>
                </Card>
            </div>
        )
    }
}
